import {connect} from 'react-redux'
import { Col } from 'react-bootstrap';
import {Panel} from 'react-bootstrap'
import  classes from './product.module.css'
const Product=()=> {
    return (
        <div className={classes.Card1}> 
        <div>                       
        <img className={classes.Imgs} src="https://dummyimage.com/600x400/55595c/fff" alt="MyPic" width="295" height="200"/>
        </div>
            <div className={classes.Container}>
             <center><h3><b>Product Name:</b></h3></center>
            </div>
            <p style={{width:"48%",float:"left"}} class="btn btn-danger btn-block">99.00 $</p>
            <p style={{width:"48%",float:"right"}} class="btn btn-success btn-block">Add to Cart</p>
      </div>
    )
       }
const mapStateToProps = state=>{
    console.log(state.product.products,"products    in Product")
    return{
        error:state.product.error,
        products:state.product.products
    }
}


export default connect(mapStateToProps)(Product)
